import React, { useState } from 'react';

function Form() {
  const [alienRegistrationNumber, setAlienRegistrationNumber] = useState(['', '', '', '', '', '', '', '', '', '']);
  const [arrivalDepartureRecordNumber, setArrivalDepartureRecordNumber] = useState(['', '', '', '', '', '', '', '', '', '', '']);

  const handleSectionChange = (e, index, setFunction) => {
    const newValue = e.target.value;

    // Validate the input to allow only digits from 0 to 9
    if (/^[0-9]$/.test(newValue)) {
      const newArray = [...setFunction];
      newArray[index] = newValue;
      setFunction(newArray);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const formattedAlienRegistrationNumber = 'A-' + alienRegistrationNumber.join('');
    const formattedArrivalDepartureRecordNumber = arrivalDepartureRecordNumber.join('');
    // Send formattedAlienRegistrationNumber and formattedArrivalDepartureRecordNumber to the backend for processing
    console.log(formattedAlienRegistrationNumber); // For demonstration purposes, log the data
    console.log(formattedArrivalDepartureRecordNumber);
  };

  return (
    <div>
      <h2>Immigration Form</h2>
      <form onSubmit={handleSubmit}>

        <div>
          <label htmlFor="alienRegistrationNumber">Alien Registration Number:</label>
          <div className="alien-registration-number">
            <span style={{ fontWeight: 'bold', marginRight: '5px' }}>A-</span>
            {alienRegistrationNumber.map((section, index) => (
              <input
                type="text"
                key={index}
                value={section}
                onChange={(e) => handleSectionChange(e, index, setAlienRegistrationNumber)}
                maxLength="1"
                pattern="\d"
                required={index === 0} // Require the first section
                style={{
                  width: '20px', // Set the width for each digit input
                  marginRight: '5px', // Add some spacing between digits
                  textAlign: 'center', // Center-align the digit
                }}
              />
            ))}
          </div>
        </div>

        <div>
          <label htmlFor="countryOfBirth">Country of Birth:</label>
          <input
            type="text"
            id="countryOfBirth"
            name="countryOfBirth"
            // Add value and onChange as needed for other fields
          />
        </div>

        <div>
          <label htmlFor="provinceOfBirth">Province of Birth:</label>
          <input
            type="text"
            id="provinceOfBirth"
            name="provinceOfBirth"
            // Add value and onChange as needed for other fields
          />
        </div>

        <div>
          <label htmlFor="countryOfCitizenship">Country of Citizenship or Nationality:</label>
          <input
            type="text"
            id="countryOfCitizenship"
            name="countryOfCitizenship"
            // Add value and onChange as needed for other fields
          />
        </div>

        <div>
          <strong>5. If the beneficiary is in the United States, complete the following:</strong>
        </div>

        <div>
          <label htmlFor="dateOfLastArrival">Date of Last Arrival (mm/dd/yyyy):</label>
          <input
            type="text"
            id="dateOfLastArrival"
            name="dateOfLastArrival"
            // Add value and onChange as needed for other fields
          />
        </div>

        <div>
          <label htmlFor="arrivalDepartureRecordNumber">I-94 Arrival-Departure Record Number (11 digits):</label>
          <div className="arrival-departure-record-number">
            {arrivalDepartureRecordNumber.map((section, index) => (
              <input
                type="text"
                key={index}
                value={section}
                onChange={(e) => handleSectionChange(e, index, setArrivalDepartureRecordNumber)}
                maxLength="1"
                pattern="\d"
                required={index === 0} // Require the first section
                style={{
                  width: '20px', // Set the width for each digit input
                  marginRight: '5px', // Add some spacing between digits
                  textAlign: 'center', // Center-align the digit
                }}
              />
            ))}
          </div>
        </div>

        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
  );
}

export default Form;
